using AppVendas.Models;
using AppVendas.Repository;
using System;
using System.Collections.Generic;
using System.Linq;
using System.Threading.Tasks;

namespace AppVendas.Services.Mock.Helpers
{
    static class CriadorBaseInicial
    {
        public static async Task CriarDadosFake()
        {
            await InserirClientes().ConfigureAwait(false);
            await InserirProdutos().ConfigureAwait(false);
            await InserirPedidos().ConfigureAwait(false);
        }

        private static async Task InserirClientes()
        {
            var repository = new ClienteRepository();

            await Add("Danimar LTDA", "Danimar", new DateTime(2019, 09, 15), "Gaspar", "SC").ConfigureAwait(false);
            await Add("Masala", "Masala", new DateTime(2019, 02, 07), "Itajaí", "SC").ConfigureAwait(false);
            await Add("Nuanoak", "Nuanoak", null, "Telêmaco Borba", "PR").ConfigureAwait(false);
            await Add("Zincoci", "Zincoci", null, "Gaspar", "SC").ConfigureAwait(false);
            await Add("Adankundîr", "Adankundîr", new DateTime(2019, 05, 18), "Blumenau", "SC").ConfigureAwait(false);
            await Add("Padaria Do João", "Padaria do João", null, "Gaspar", "SC").ConfigureAwait(false);
            await Add("Julio Tiago da Silvao", null, null, "São Paulo", "SP").ConfigureAwait(false);
            await Add("Pedro de Alcântara Francisco Antônio João Carlos Xavier", "Pedro de Alcântara Francisco Antônio João Carlos", null, "Jijoca de Jericoacoara", "CE").ConfigureAwait(false);

            async Task Add(string razaoSocial, string nomeFantasia, DateTime? dataUltimoPedido, string cidade, string estadoSigla)
            {
                if (string.IsNullOrWhiteSpace(nomeFantasia))
                    nomeFantasia = null;

                await repository.SalvarAsync(new Cliente
                {
                    RazaoSocial = razaoSocial,
                    NomeFantasia = nomeFantasia ?? razaoSocial,
                    DataUltimoPedido = dataUltimoPedido,
                    Cidade = cidade,
                    EstadoSigla = estadoSigla,
                }).ConfigureAwait(false);
            }
        }

        private static async Task InserirProdutos()
        {
            const string base64image = "";

            var repository = new ProdutoRepository();

            await Add("Beterraba em conserva 12x500g Danimar", "CX12", 5.83m, 70).ConfigureAwait(false);
            await Add("Brocolis em conserva 15x300g Danimar B", "CX15", 5.33m, 80).ConfigureAwait(false);
            await Add("Cenoura em conserva 15x300g Danimar", "CX15", 5.33m, 80).ConfigureAwait(false);
            await Add("Mini salsichas em conserva 12x180g DANIMAR", "CX12", 6.46m, 77.50m).ConfigureAwait(false);
            await Add("Ovos de codorna em conserva 15x300 DANIMAR", "CX15", 6.87m, 103).ConfigureAwait(false);


            async Task Add(string descricao, string unidade, decimal valorUnitario, decimal valor)
            {
                await repository.SalvarAsync(new Produto
                {
                    Descricao = descricao,
                    Unidade = unidade,
                    Valor = valor,
                    ValorUnitario = valorUnitario,
                    Foto = Convert.FromBase64String(base64image)
                }).ConfigureAwait(false);
            }
        }

        private static async Task InserirPedidos()
        {
            var produtoRpository = new ProdutoRepository();
            var pedidoRepository = new PedidoRepository();

            var produtos = await produtoRpository.ObterTodosAsync().ConfigureAwait(false);

            var produto1 = produtos[0];
            var produto2 = produtos[1];
            var produto3 = produtos[2];

            await InserirPedido(new Pedido
            {
                ClienteId = 1,
                Data = new DateTime(2019, 10, 1, 15, 00, 00),
                Produtos = new List<ProdutoPedido>
                {
                    Criar(produto1, 10),
                    Criar(produto2, 15),
                    Criar(produto3, 17),
                }
            }).ConfigureAwait(false);

            await InserirPedido(new Pedido
            {
                ClienteId = 1,
                Data = new DateTime(2019, 5, 15, 17, 30, 00),
                Produtos = new List<ProdutoPedido>
                {
                    Criar(produto1, 20),
                }
            }).ConfigureAwait(false);

            await InserirPedido(new Pedido
            {
                ClienteId = 1,
                Data = new DateTime(2018, 12, 1, 08, 00, 00),
                Produtos = new List<ProdutoPedido>
                {
                    Criar(produto3, 50),
                }
            }).ConfigureAwait(false);

            async Task InserirPedido(Pedido pedido)
            {
                pedido.ValorTotal = pedido.Produtos.Sum(x => x.ValorTotal);
                await pedidoRepository.SalvarAsync(pedido).ConfigureAwait(true);
            }
        }

        private static ProdutoPedido Criar(Produto produto, decimal qtd)
        {
            return new ProdutoPedido
            {
                ProdutoId = produto.Id,
                Descricao = produto.Descricao,
                Unidade = produto.Unidade,
                Valor = produto.Valor,
                ValorUnitario = produto.ValorUnitario,
                Quantidade = qtd,
                ValorTotal = produto.Valor * qtd
            };
        }
    }
}
